module.exports = "<mat-card class=\"help-card\">\n    <div class=\"header\">\n      <mat-card-title><h3>Help</h3></mat-card-title>\n      <mat-card-subtitle>A Guide for using this PTO publishing App.</mat-card-subtitle>\n    </div>\n    <img mat-card-image [src]=\"helpImagePath_1\" alt=\"Photo of Help Image-1\">\n    <mat-card-content>\n      <p>\n        The PTO publishing App will open in the browser after logging in and on clicking the link \"PTO\" on \n        Heading bar at top left of the page.The page consists of a Main Panel and a Side Nav Panel below \n        the Heading Bar. The Main Panel is for \n        displaying the data or forms as per the menu items chosen in the Side Nav Panel. The menu items\n        in the Side Nav Panel and their functions are as under :\n      </p>\n      <h4>Side Nav Panel</h4>\n        <ol>\n          <li>List :</li><p>The \"List\" Menu Item displays the list of all PTOs in the Main Panel and is also \n            the default Menu Item on opening of the PTO page of the App. The List can be Searched (Filtered) \n            and Sorted on any Column. Enter the required field at the top of any Column and press the\n             \"Search\" button to filter the PTOs on that field. To Sort on any Column click the Arrows Icons \n             below the textfields. The individual PTO row on clicking \n            will open the details of the PTO with all its Casualities listed.</p>\n          <li>New PTO :</li><p>The \"New PTO\" Menu Item opens a form for creating new PTO, which contains five \n            text fields for No., Year, Unit, Station and Date of the PTO. If you have previously saved the \n            form by pressing the Menu Item in Para 4 below but not Publised it, then the form would show the \n            PTO filled with previously saved PTO. After finishing with the values in the PTO \n            text fields, click on \"New Casuality\".</p>\n          <li class=\"new\">New Casuality :</li><p>Clicking on it opens a new form for a new Casuality under the PTO form as shown under.\n            The seven text fields for S.No., MES No., Name, Category, Date, Type and Particulars fully define \n            a Casuality for any employee. On clicking on the \"MES No\" field a list of MES Nos. availabe on the \n            \"Database\" page of the App will popup. Further on selecting the chosen MES No from the list the \"Name\"\n            and the \"Category\" fields shall automatically get filled corresponding to the \"Name\" and \"Category\" details \n            available for the \"MES No.\" in the \"Database\". If the desired MES No for which the Casuality is required \n            to be published is not showing in the popup list, then it means that the record for this MES No.is not \n            available in the Database. Hence you may first add the person's record on the Databse page before \n            publishing his/her casuality. However you can publish a person's casuality wihtout the Autofill feature\n            if his/her record is not available in the Database by manually filling the \"Name\" and \"Category\" fields.\n             The \"Particular\" text field also get automatically filled with a templete\n            on selecting a \"Type\" from the drop down list. It should be then completed to specify the actual Particular of the casuality\n             for the employee by filling the blanks in the templete of the Casuality or amending it as required.</p>\n            <img mat-card-image [src]=\"helpImagePath_2\" alt=\"Photo of Help Image-2\">\n             <li>Publish... :</li><p>After filling the PTO form and adding and completing the required nos. of \n            Casualities, you would like to Publish it. On clicking this Menu Item you are presented with a preview \n            of the completed PTO form which you have filled in the above Menu items. Also the PTO is saved on your \n            computer as a draft which could be loaded back till it is not publised. If everything is alright \n            you may press the \"Publish\" button on the \"Preview\" page to upload it onto the database. Once it is uploaded to the database \n            it cannot be amended therafter. Also any PTO for a particular combination of PTO No., PTO Year, Unit, \n            Station and Date, once published it cannot be published again thereby avoiding duplicate PTOs in the \n            database. However if you feel some correction is required, you have a chance to correct it by pressing \n            the \"Edit\" button before pressing the \"Publish\" button. Also there is option to Print the completed PTO by \n            pressing the \"Print\" button.</p>\n          <li>MES No. :</li><p>This is not an action button but a textfield where you put in the MES No. of the \n            employee whose casualities you want to search. All the casualities for the employee with this MES No.\n             are searched in the entire database and listed in the Main Panel if you leave the following two \n             textfields of \"PTO Date From\" and \"PTO Date Upto\" blank. However if you you want the casualities of \n             the employee for a particular period, you need to fill the textfield at Para 6 and 7 below to get \n             the filtered casualities of the employee within the period specified.</p>\n          <li>PTO Date From :</li><p>As specified in the Para above, the textfield when filled will filter the \n            casualities of the employee with MES No. specified in Para 5 above to only those casualities whose \n            PTO date falls on or after this date.</p>\n          <li>PTO Date Upto :</li><p>As specified in the Para 5 above, the textfield when filled will filter the \n              casualities of the employee with MES No. specified in Para 5 above to only those casualities whose \n              PTO date falls on or before this date.</p>\n          <li>Search Casualities :</li><p>This is the action button for the Search Casualities Form specified from \n            Para 5 to Para 7 above. After filling the textfields in the Para 5 to 7 specified above, pressing this \n            button will show the casualities in the Main Panel. The individual rows of the casualities are also \n            clickable, which on clicking shows the PTO to which this casuality belongs.</p>\n          <li>Help :</li><p>This Menu Item is for displaying this Help page in the Main Panel of the App.</p>\n        </ol>\n      \n    </mat-card-content>\n  </mat-card>"

